// ==UserScript==
// @name        Mydealz Link Uncloak
// @namespace   lolnickname
// @icon        data:image/x-icon;base64,
// @include     https://www.mydealz.de*
// @description Uncloak Mydealz Links
// @version     0.1.1
// @grant       GM_xmlhttpRequest 
// ==/UserScript==
/*// @include     /^https?:\/\/www\.mydealz\.de\/(gutscheine|deals)\/.+-\d+(\?page=\d+)?(#comment-\d+|#thread-comments|#comment-form)?$/*/
var REGEX_THREAD = /^https?:\/\/www\.mydealz\.de\/visit\/thread(image)?\/\d+$/;
var REGEX_DESC = /^https?:\/\/www\.mydealz\.de\/visit\/threaddesc\/\d+\/\d+$/;
var REGEX_COMMENT = /^https?:\/\/www\.mydealz\.de\/visit\/comment\/\d+\/\d+$/;
var OBSERVER_THREAD_LIST = '.fGrid-last2';
var OBSERVER_COMMENT_LIST = '.comments-list';
var OBSERVER_PROFIL_SEARCH = '.thread-list--type-list.width--all-12.fGrid.space--mb-4'

unCloak();

var tragetTL = document.querySelector(OBSERVER_THREAD_LIST);
var targetCL = document.querySelector(OBSERVER_COMMENT_LIST);
var targetPS = document.querySelector(OBSERVER_PROFIL_SEARCH);
var observer = new MutationObserver(function(mutations) {
  unCloak();
});
var config = { attributes: false, childList: true, characterData: true };
if (tragetTL != null) {
  observer.observe(tragetTL, config);
}
if (targetCL != null) {
  observer.observe(targetCL, config);
}
if (targetPS != null) {
  observer.observe(targetPS, config);
}

function unCloak() {
  var urlKey = {};
  var aArray = document.getElementsByTagName('a');
  var arrayLength = aArray.length;
  for (var i = 0; i < arrayLength; i++) {
    var url = aArray[i].href;
    if (url.match(REGEX_THREAD) || url.match(REGEX_DESC) || url.match(REGEX_COMMENT)) {
      aArray[i].href = '#';
      urlKey[url] = aArray[i];
      GM_xmlhttpRequest({
        method: 'GET',
        url: url,
        onload: function (response) {
          var a = urlKey[this.url]
          a.href = response.finalUrl;
        }
      });
    }
  }
}
